import React from 'react';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';

const StyledWrapper = styled.nav`
  position: fixed;
  top: 0;
  width: 100%;
  max-width: 1000px;
  height: 150px;
  background-color: ${({ theme }) => theme.yellow};
  display: flex;
  align-items: center;
`;

const StyledLogoLink = styled(NavLink)`
  display: block;
  text-decoration: none;
`;

const StyledLinksList = styled.ul`
  margin: 0;
  padding: 0;
  list-style: none;
`;

const StyledLink = styled.h2`
  color: green;
  margin: 0;
  padding: 0;
  list-style: none;
  text-decoration: none;
`;

const NavBar = () => (
  <StyledWrapper>
    <StyledLogoLink to="/">Olx.app</StyledLogoLink>
    <StyledLinksList>
      <li>
        <StyledLink as={NavLink} to="/posts">
          Home
        </StyledLink>
      </li>
    </StyledLinksList>
  </StyledWrapper>
);

export default NavBar;
